import axios from "axios";
import { useEffect, useState } from "react";
import "./App.css";
import Card from "./components/Card/Card";

function App() {
  const element = {
    name: "Pikachu",
    img: "https://assets.stickpng.com/images/580b57fcd9996e24bc43c325.png",
  };

  const [elements, setElements] = useState([]);

  useEffect(() => {
    axios
      .get("https://pokeapi.co/api/v2/pokemon?limit=700")
      .then((res) => {
        setElements(res.data.results);
      })
      .catch((err) => console.log(err));
  }, []);

  return (
    <div className="app">
      <h1 className="app__title">Pokédex</h1>
      <input
        className="app__input"
        type="text"
        placeholder="Enter the name of a Pokémon"
      >
        <img
          src="https://assets.stickpng.com/images/580b57fcd9996e24bc43c325.png"
          alt="img"
          width="10px"
          height="10px"
        />
      </input>
      <div className="app__items">
        {elements.map((element) => (
          <Card key={element.url} element={element} />
        ))}
      </div>
    </div>
  );
}

export default App;
